import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import { useCookies } from 'react-cookie'
import { Link } from 'react-router-dom';
import img from '../img/logo.png'
import '../css/NavBar.css';

const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    menuButton: {
      marginRight: theme.spacing(2),
    },


  }));

const NavBar = () => {

    const classes = useStyles();
    const [cookie, setCookie, removeCookie] = useCookies()

    return (
        <div className={classes.root}>
        <AppBar position="static">
          <Toolbar>
            <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
              <MenuIcon />
            </IconButton>
            <Button color="inherit"><Link to="/Movielist">Filmler</Link></Button>
            <Button color="inherit"><Link to="/Tvshow">Diziler</Link></Button>
            <Button color="inherit"><Link to="/People" style={{textDecoration:"none", color:"white"}}>Kişiler</Link></Button>


          </Toolbar>
        </AppBar>
      </div>
    )
}

export default NavBar;
